import React from 'react';
import { Link } from 'react-router-dom';
import './livestream.css';
import { FaHome, FaChartLine, FaUser, FaShoppingCart } from 'react-icons/fa';

function Livestream() {
  return (
    <div className="app-container">
      <div className="sidebar">
        <div className="sidebar-header">
          <h2>Container</h2>
        </div>
        <div className="sidebar-menu">
          <Link to="/" className="menu-item"><FaHome className="icon" /><span>Register</span></Link>
          <Link to="/sales" className="menu-item"><FaShoppingCart className="icon" /><span>Livestream</span></Link>
          <Link to="/customer" className="menu-item"><FaUser className="icon" /><span>Q-A Assistant</span></Link>
          <Link to="/databasepage" className="menu-item"><FaChartLine className="icon" /><span>Database</span></Link>
        </div>
        <div className="sidebar-footer">
          <span className="user-name">POORANI</span>
        </div>
      </div>

      <div className="main-content">
        <div className="stream-container">
          <h3>Live Face Recognition</h3>
          <p>Streaming and identifying faces in real-time</p>
          <img
            src="http://localhost:5000/video_feed"
            alt="Live Stream"
            style={{ width: '100%', border: '2px solid black', borderRadius: '8px' }}
          />
        </div>
      </div>
    </div>
  );
}

export default Livestream;
